void displayTemp(char str[50]){
	sprintf(str,"Temp = %4.1f\t Humi = %4.1f\n\r",t,h);
		while(__HAL_UART_GET_FLAG(&huart3,UART_FLAG_TC)==RESET){}
		HAL_UART_Transmit(&huart3,(uint8_t *) str,strlen(str),200);
		HAL_Delay(100);
}

void getTemp(uint8_t cmdBuffer[3],uint8_t dataBuffer[8]){
	//wakeup
		HAL_I2C_Master_Transmit(&hi2c1,0x5c<<1 , cmdBuffer,3,200);
			//send cmd
		HAL_I2C_Master_Transmit(&hi2c1,0x5c<<1 , cmdBuffer,3,200);
			
			HAL_Delay(1);
			HAL_I2C_Master_Receive(&hi2c1,0x5c<<1 , dataBuffer,8,200);
			
			uint16_t Rcrc = dataBuffer[7]<<8;
			Rcrc += dataBuffer[6];
			if(Rcrc == CRC16_2(dataBuffer,6)){
				
				uint16_t temperature = ((dataBuffer[4] & 0x7F) <<8)+dataBuffer[5];
				t=temperature / 10.0;
				t=(((dataBuffer[4] & 0x80)>>7)== 1)?(t*(-1)):t;
				
				uint16_t humidity = (dataBuffer[2]<<8) + dataBuffer[3];
				h=humidity/10.0;
			}
}

uint16_t genRGB(uint16_t r,uint16_t g,uint16_t b){
			char str[50];
	    r *=26;
	    g *=26;
	    b *=26;
			r/=10;
			r <<= 11;
			g /=5;
			g <<= 5;
			b/=10;
			uint16_t RGB_color = r+g+b;
			sprintf(str,"\n\r%04x\n\r",RGB_color);
			//HAL_UART_Transmit(&huart3,(uint8_t *) str,strlen(str),200);
	return RGB_color;
}
