uint16_t CRC16_2(uint8_t *ptr, uint8_t length)
{
	uint16_t crc = 0xFFFF;
	uint8_t s =0x00;
	
	while (length--){
		crc ^= *ptr++;
		for(s = 0; s < 8; s++ ){
			if((crc & 0x01) != 0 ) {
				crc >>= 1;
				crc ^= 0xA001;
			}else crc >>= 1;
		}
	}
	return crc;
}

